import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<div class="${classMap(context.classes.root)}" tabindex="-1" @keydown=${context._onkeydown} @focusin="${context._onfocusin}" @focusout="${context._onfocusout}">${ context._hasHoursSlider ? block1(context) : undefined }${ context._hasMinutesSlider ? block2(context) : undefined }${ context._hasSecondsSlider ? block3(context) : undefined }${ context._hasPeriodsSlider ? block4(context) : undefined }</div>`; };
const block1 = (context) => { return html`<${scopeTag("ui5-wheelslider", tags, suffix)} label = "${ifDefined(context.hoursSliderTitle)}" ._items="${ifDefined(context.hoursArray)}" data-sap-focus-ref ?expanded="${context._hoursSliderFocused}" value="${ifDefined(context._hours)}" @ui5-select="${ifDefined(context.onHoursChange)}" @click="${context.selectSlider}" @focusin="${context.selectSlider}" data-sap-slider="hours" ?cyclic="${context._isCyclic}"></${scopeTag("ui5-wheelslider", tags, suffix)}>`; };
const block2 = (context) => { return html`<${scopeTag("ui5-wheelslider", tags, suffix)} label = "${ifDefined(context.minutesSliderTitle)}" ._items="${ifDefined(context.minutesArray)}" ?expanded="${context._minutesSliderFocused}" value="${ifDefined(context._minutes)}" @ui5-select="${ifDefined(context.onMinutesChange)}" @click="${context.selectSlider}" @focusin="${context.selectSlider}" data-sap-slider="minutes" ?cyclic="${context._isCyclic}"></${scopeTag("ui5-wheelslider", tags, suffix)}>`; };
const block3 = (context) => { return html`<${scopeTag("ui5-wheelslider", tags, suffix)} label = "${ifDefined(context.secondsSliderTitle)}" ._items="${ifDefined(context.secondsArray)}" ?expanded="${context._secondsSliderFocused}" value="${ifDefined(context._seconds)}" @ui5-select="${ifDefined(context.onSecondsChange)}" @click="${context.selectSlider}" @focusin="${context.selectSlider}" data-sap-slider="seconds" ?cyclic="${context._isCyclic}"></${scopeTag("ui5-wheelslider", tags, suffix)}>`; };
const block4 = (context) => { return html`<${scopeTag("ui5-wheelslider", tags, suffix)} label = "${ifDefined(context.periodSliderTitle)}" ._items="${ifDefined(context.periodsArray)}" ?expanded="${context._periodSliderFocused}" value="${ifDefined(context._period)}" @ui5-select="${ifDefined(context.onPeriodChange)}" @click="${context.selectSlider}" @focusin="${context.selectSlider}" data-sap-slider="period"></${scopeTag("ui5-wheelslider", tags, suffix)}>`; };


	return block0(context);
};

export default main;
